import {useHistory} from "react-router-dom"
import Button from "react-bootstrap/Button"

export default function History(){
    //gallons, delivery address, delivery datae, price/gallon, amount due
    var [rows1, setRows1] = useState([])

    useEffect(() => {
        const addRow = async () =>{
            setRows1([{
                Gallons: 2,
                Address: 'Road rd',
                Date: 'Tomorrow',
                Price: 24,
                Due: 35,
            }, 'row 2', 'row3'])
        }

        addRow()
    })

    var gallons = rows1.map((r) =>(
        <p>{r}</p>
    ))

    

    return(
        <div>
            <table>
                <tr>
                    <td>Gallons</td>
                    <td>Address</td>
                    <td>Delivery Date</td>
                    <td>Price per gallon</td>
                    <td>Amount Due</td>
                </tr>
                {example}
            </table>
        </div>
    )
}
